import { useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { patientAPI } from "../../api/api";

function Dashboard({ user }) {
  const [summary, setSummary] = useState(null);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    if (!user) {
      navigate("/");
      return;
    }

    const fetchSummary = async () => {
      try {
        const patientId = user.id;
        console.log("Fetching summary for patient ID:", patientId);
        const res = await patientAPI.get(`summary/${patientId}/`);
        console.log("Summary response:", res.data);
        setSummary(res.data);
        setLoading(false);
      } catch (err) {
        console.error("Error fetching summary:", err);
        setLoading(false);
      }
    };

    fetchSummary();
  }, [user, navigate]);

  if (!user) return null;

  if (loading) {
    return (
      <div className="container">
        <div className="card">
          <p>Loading...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="container">
      <div className="card">
        <div className="header">
          <h2>Welcome, {user.first_name} {user.last_name}</h2>
          <button className="btn btn-secondary" onClick={() => navigate("/")}>
            Logout
          </button>
        </div>

        <div className="nav-links">
          <Link to="/portal/appointments">All Appointments</Link>
          <Link to="/portal/medications">All Medications</Link>
        </div>

        <div style={{marginTop: '20px'}}>
          <h3>Patient Information</h3>
          <p><strong>Email:</strong> {user.email}</p>
          <p><strong>Date of Birth:</strong> {user.date_of_birth}</p>
          <p><strong>Phone:</strong> {user.phone || "N/A"}</p>
        </div>

        {summary && (
          <>
            <div style={{marginTop: '30px'}}>
              <h3>Upcoming Appointments (Next 7 Days)</h3>
              {summary.upcoming_appointments && summary.upcoming_appointments.length > 0 ? (
                <table>
                  <thead>
                    <tr>
                      <th>Date & Time</th>
                      <th>Doctor</th>
                      <th>Reason</th>
                      <th>Status</th>
                    </tr>
                  </thead>
                  <tbody>
                    {summary.upcoming_appointments.map((apt, index) => (
                      <tr key={index}>
                        <td>{new Date(apt.appointment_date).toLocaleString()}</td>
                        <td>{apt.doctor_name}</td>
                        <td>{apt.reason}</td>
                        <td>{apt.status}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              ) : (
                <p className="alert alert-info">No upcoming appointments in the next 7 days.</p>
              )}
            </div>

            <div style={{marginTop: '30px'}}>
              <h3>Medications Needing Refill Soon</h3>
              {summary.refill_needed && summary.refill_needed.length > 0 ? (
                <table>
                  <thead>
                    <tr>
                      <th>Medication</th>
                      <th>Dosage</th>
                      <th>Refills Remaining</th>
                      <th>Prescribed By</th>
                    </tr>
                  </thead>
                  <tbody>
                    {summary.refill_needed.map((med, index) => (
                      <tr key={index}>
                        <td>{med.medication_name}</td>
                        <td>{med.dosage}</td>
                        <td>{med.refills_remaining}</td>
                        <td>{med.prescribed_by}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              ) : (
                <p className="alert alert-info">No medications need refills soon.</p>
              )}
            </div>
          </>
        )}
      </div>
    </div>
  );
}

export default Dashboard;
